const productsData = [
    { id: 1, name: 'Product A', category: 'Category 1', price: 10.99, quantity: 5 },
    { id: 2, name: 'Product B', category: 'Category 2', price: 20.99, quantity: 15 },
    { id: 3, name: 'Product C', category: 'Category 1', price: 30.99, quantity: 8 },
    { id: 4, name: 'Product D', category: 'Category 3', price: 40.99, quantity: 25 }
];

export default productsData;
